import React, {Component} from 'react';
import Navbar from 'react-bootstrap/Navbar';

class TunaNavBar extends Component {

    render() {
        return(
            <Navbar bg="dark" expand="large">
                <Navbar.Brand>Tuna</Navbar.Brand>

            </Navbar>
        )
    }
}

export default TunaNavBar;
